// About.js
import React from 'react';
import './About.css'; // Import the CSS file for styles
import iceland from './images/iceland.jpg'; // Adjust the path to your image

const About = () => {
    return (
        <section id="section2">
            <h1 className="header">About Me</h1>
            <div className="content">
                <img src={iceland} alt="Iceland" className="image" />
                <div className="text-content">
                    <h2 className="major">UCSC Graduate</h2>
                    <h3 className="minor">Major in Computer Science</h3>
                    <h3 className="minor">Minor in Technology and Information Management</h3>
                    <p className="goal">
                        Goal: Unleashing Innovation Through Code: Empowering Business Success with Proficiency, Passion, and Excellence.
                    </p>
                    <div className="resume-button">
                        <a href="https://www.example.com/path-to-your-resume.pdf" className="resume-link">View Resume</a>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default About;
